              Sign Out
            </Button>
        </Grid>

        </Toolbar>
      </AppBar>

        <Paper className={classes.paper}>
          Business Setup....................................................03/04
        <LinearProgress variant="determinate" value={75} />

        <Typography variant="h6" color="inherit" noWrap>
            Your Business Details.
