      <br></br>
      <TextField id="outlined-basic" label="Basket Size" placeholder="Basket Size e.g. R12000" variant="outlined" />
      <br></br>
      This is the average amount your consumer spends at checkout.
      <br></br>
          <React.Fragment>
          <Button
              type="submit"
              variant="outlined"
              style={{backgroundColor: '#fff', color: '#000'}}
