            >
              Skip Step
            </Button>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              onClick={()=>changeState(2)}
            >
              Continue
            </Button>
          </React.Fragment>
        </Paper>
        <Copyright />

    </React.Fragment>
    );
}


export default Otp;
